/* eslint-disable jsx-a11y/img-redundant-alt */
import React from "react";
import Logo from "./big-logo.548c53616e0e56bf33df.png";
const NavBar = () => {
  return (
    <header>
      <div className="logo">
        <img src={Logo} alt="my logo image" />;
      </div>
      <div>MENU</div>
    </header>
  );
};

export default NavBar;
